import Feed from "../components/Feed"

const useStyles = makeStyles((theme) => ({
  container: {
    marginTop: theme.spacing(4),
  },
}))


const FeedPage = () => {
  const classes = useStyles()

  const getFeed = () => {
    return [
      ({id: 1, })
    ]
  }
  return (
    <Container className={classes.container} maxWidth="md">
      <Feed
        poster="Adam Rodrigues"
        post="Enim sunt laboris consequat id anim reprehenderit ipsum. Veniam elit tempor adipisicing adipisicing incididunt irure laborum enim id aute. Nostrud qui irure est ad ex non non proident minim eu."
        comments="2"
        likes="1"
      ></Feed>
    </Container>
  )
}

export default FeedPage
